import { Button, Space, Form, Typography } from 'antd';
import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import moment from 'moment';
const { Text, Link } = Typography;
const Exam = () => {
	const userId = localStorage.getItem('userId');
	const { id } = useParams();
	const [now, setNow] = useState(moment());

	const endDate = moment('2021-02-09 17:16', 'YYYY-MM-DD HH:mm');
	const [remainHour, setRemaintime] = useState(
		now.subtract(endDate.hour, 'hours')
	);
	const [remainMinute, setMinute] = useState(
		now.subtract(endDate.minute, 'minutes')
	);
	const initialHour = () => {
		return;
	};
	const initialMinute = () => {
		return;
	};
	useEffect(() => {
		let myInterval = setInterval(() => {
			initialMinute;
		}, 60000);
		return () => {
			clearInterval(myInterval);
		};
	});
	return (
		<Form>
			<Space direction={'vertical'}>
				<Form.Item>
					<Text>Remain Time : {now.format('HH')}</Text>
				</Form.Item>
				<Form.Item>
					<Button>Submit</Button>
				</Form.Item>
				<Form.Item>
					<di>{id}</di>
				</Form.Item>
			</Space>
		</Form>
	);
};
export default Exam;
